import React from "react";
import "./RandomRecipeInfo.css";
import Button from "../../../ui/Button";

export default function RandomRecipeInfo() {
  return (
    <div className="RandomRecipeInfo">
      <h2 id="randomRecipeName">Deruny</h2>
      <p id="randomRecipeSynopsis">Ukrainian Potato Pancakes</p>
      <Button id="goToRecipe" text="Go to recipe!" />
    </div>
  );
}
